func testAssetToManyAddOpAudioWalks(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Asset
	var b, c, d, e Walk

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, assetDBTypes, false, strmangle.SetComplement(assetPrimaryKeyColumns, assetColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*Walk{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, walkDBTypes, false, strmangle.SetComplement(walkPrimaryKeyColumns, walkColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*Walk{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddAudioWalks(ctx, tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if !queries.Equal(a.ID, first.AudioID) {
			t.Error("foreign key was wrong value", a.ID, first.AudioID)
		}
		if !queries.Equal(a.ID, second.AudioID) {
			t.Error("foreign key was wrong value", a.ID, second.AudioID)
		}

		if first.R.Audio != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.Audio != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.AudioWalks[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.AudioWalks[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.AudioWalks().Count(ctx, tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}

